const HomePage = () => {
    return ( 
        <>
            <div className="content">
                    <table>
                        <tr style={{
                        float: 'left',
                        margin: '0px 0px 0px 0%',
                        paddingBottom: '1.75%'
                        }}>

                            <HPMainCard01 />
